(()=>{"use strict";document.querySelector(".schedule").addEventListener("click",(e=>{const t=e.target;if(t.classList.contains("schedule-plus")){const e=t.previousElementSibling.lastElementChild;t.classList.toggle("active-plus"),e.style.maxHeight?(e.style.maxHeight=null,e.style.animation="margin 0.3s forwards"):(e.style.maxHeight=e.scrollHeight+"px",e.style.marginTop="30px",e.style.animation=null)}}))})();